import React, { Component } from 'react'
import axios from 'axios';
const API = 'AIzaSyDauqfEEKYaLV-tkZDCWHkgLycKWPjjeNY'
const channelID = 'UCan48A3vtMqg1gvYmHl-iVA'
const result = 10;
var finalURL = `https://www.googleapis.com/youtube/v3/search?part=snippet&channelId=${channelID}&maxResults=${result}&key=${API}`



export default class Listing extends Component {

    constructor(props) {
        super(props);
        this.state = {
            result: [],

        };

    }
    clicked() {
        fetch(finalURL)
            .then((response) => response.json())
            .then((responseJson) => {
                console.log(responseJson)
                // const result = responseJson.items.map(obj => "https://www.youtube.com/embed/" + obj.id.videoId)
                this.setState({ result });
                console.log(this.state.result)
            })
            .catch((error) => {
                console.error(error);
            });

    }


    render() {
        console.log(this.state.result)
        // console.log(finalURL)
        return (
            <div>

                <div>{this.state.result}</div>

            </div>
        )
    }
}
